import React from 'react';
import Map from './Map';

const App: React.FC = () => {
  return (
    <div className="flex flex-col m-10">
      <h1 className="text-3xl font-bold m-4 p-10">Eras Tour Tracker</h1>
      <h2 className="text-3xl font-bold m-4 p-10">Next tour:</h2>
      <img src="./images/eras-tour.png" alt="Eras Tour" className="m-10 p-5" />
      <Map />
    </div>
  );
};

export default App;
